import React from "react";
import Merlion from "./merlion.png";

const Home = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <img src={Merlion} width="30%" />
      <h1>Missing Singapore? We are here to help!</h1>
      <h6>- F00Lstack</h6>
    </div>
  );
};

export default Home;
